// src/pages/Volunteer.jsx
function Volunteer() {
  return (
    <section className="container">
      <h1 className="page-title">Devenir bénévole</h1>
      <p>
        Vous souhaitez donner un peu de votre temps pour aider Les Colis du
        Cœur ? Rejoignez notre équipe de bénévoles !
      </p>
      <p>
        (Cette page accueillera bientôt un formulaire simple pour que les
        personnes intéressées puissent laisser leurs coordonnées et
        disponibilités.)
      </p>
    </section>
  );
}

export default Volunteer;
